// SPDX-License-Identifier: MIT
pragma solidity ^0.8.4;

import "../ERC721/IERC721ReceiverUpgradeable.sol";
import "../ERC20/ERC20Upgradeable.sol";
import "../ERC721/ERC721Upgradeable.sol";

contract TokenHolderUpgradeable is Initializable, IERC721ReceiverUpgradeable{
    function __ERC721Holder_init() internal onlyInitializing {
    }

    function __ERC721Holder_init_unchained() internal onlyInitializing {
    }
    /**
     * @dev See {IERC721Receiver-onERC721Received}.
     *
     * Always returns `IERC721Receiver.onERC721Received.selector`.
     */
    function onERC721Received(
        address,
        address,
        uint256,
        bytes memory
    ) public virtual override returns (bytes4) {
        return this.onERC721Received.selector;
    }
    //------------------------------------ERC721------------------------------------------
    function adminSendERC721Token(
        address token,
        address from,
        address to,
        uint256 tokenId
    ) external {
        ERC721Upgradeable(token).safeTransferFrom(from, to, tokenId);
    }

    function adminSetApprovalERC721ForAll(
        address token, 
        address operator,
        bool _approved
    ) external {
        ERC721Upgradeable(token).setApprovalForAll(operator, _approved);
    }
    //------------------------------------ERC20------------------------------------------
    function adminTransferERC20Token(
        address token,
        address from,
        address to,
        uint256 amount
    ) external {
        ERC20Upgradeable(token).transferFrom(from, to, amount);
    }

    function adminSetApprovalERC20(
        address token,
        address spender,
        uint256 amount
    ) external {
        ERC20Upgradeable(token).approve(spender, amount);
    }

    /**
     * @dev This empty reserved space is put in place to allow future versions to add new
     * variables without shifting down storage in the inheritance chain.
     * See https://docs.openzeppelin.com/contracts/4.x/upgradeable#storage_gaps
     */
    uint256[50] private __gap;
}

